/*********************************************************************
*
*       MainTask
*
*/
void MainTask(void);
void MainTask(void) {
  char n = 0;
  GUI_Init();
  GUI_SetBkColor(GUI_WHITE);
  GUI_Clear();
  GUI_DrawBitmap(&bmusb_image,80,50);
  GUI_SetColor(GUI_BLACK);
  GUI_SetFont(&GUI_Font20B_ASCII);
  GUI_DispString("USB Mass Storage Device sample\n");
  USB_Init();
  FS_Init();
  _FSTest();
  _AddMSD();
  USB_Start();
  while (1) {
    //
    // Wait for configuration
    //
    while ((USB_GetState() & (USB_STAT_CONFIGURED | USB_STAT_SUSPENDED)) != USB_STAT_CONFIGURED) {
      BSP_ToggleLED(0);
      GUI_GotoXY(0,190);
      GUI_DispString("Enumeration...");
      GUI_DispString(aProgressString[n]);
      n++;
      n &= 0x03;
      USB_OS_Delay(50);
    }
    GUI_GotoXY(0,190);
    GUI_DispString("Connected!       ");
    BSP_SetLED(0);
    USB_MSD_Task();
  }
}

